import React from 'react';
// components
import Headerwhite from './layouts/Header_white';
import Footer from './layouts/Footer';
import Slider from './slider';
// FontAwesome
import './FontAwesome';
function HomePage(){
    return(
        <div>
            <Headerwhite/>         
            <Slider/>
            <Footer/>       
        </div>
    )
};
export default HomePage;
